{
  "text": "",
  "children": [
    {
      "text": "思想建党、政治建军"
    },
    {
      "text": "古田会议奠基的军队政治工作对军队生存发展起到了决定性作用"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "遵义会议是党的历史上一个生死攸关的转折点。这次会议在红军第五次反“围剿”失败和长征初期严重受挫的历史关头召开"
    },
    {
      "text": "事实上确立了毛泽东在党中央和红军的领导地位，开始确立了以毛泽东为主要代表的马克思主义正确路线在党中央的领导地位，开始形成以毛泽东为核心的第一代中央领导集体"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "中国共产党抗日救国十大纲领"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "首次提出马克思主义中国化"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "提交《论联合政府》政治报告"
    },
    {
      "text": "把毛泽东思想确立为全党的指导思想并载入党章"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "指出中国由农业国转变为工业国、由新民主主义社会转变为社会主义社会的发展方向。"
    },
    {
      "text": "确定了党的工作重心由乡村转移到城市的问题。毛泽东在全会上提出“两个务必”思想，即：“务必使同志们继续地保持谦虚、谨慎、不骄、不躁的作风，务必使同志们继续地保持艰苦奋斗的作风。"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "国内的主要矛盾",
      "children": [
        {
          "text": "已经是人民对于建立先进的工业国的要求同落后的农业国的现实之间的矛盾"
        },
        {
          "text": "已经是人民对于经济文化迅速发展的需要同当前经济文化不能满足人民需要的状况之间的矛盾"
        }
      ]
    },
    {
      "text": "党和人民当前的主要任务，就是要集中力量解决这个矛盾，把我国尽快地从落后的农业国变为先进的工业国"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "批判了“两个凡是”的错误方针"
    },
    {
      "text": "实践是检验真理的唯一标准"
    },
    {
      "text": "停止使用“以阶级斗争为纲”的口号，作出把党和国家工作中心转移到经济建设上来、实行改革开放的历史性决策"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "阐述社会主义初级阶段理论"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "江泽民"
    },
    {
      "text": "确定我国经济体制改革的目标是建立社会主义市场经济体制"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "阐述邓小平理论的历史地位和指导意义"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "胡锦涛"
    },
    {
      "text": "提出全面建设小康社会的奋斗目标，阐述全面贯彻“三个代表”重要思想的根本要求"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "全面阐述科学发展观的科学内涵、精神实质和根本要求，明确科学发展观第一要义是发展，核心是以人为本，基本要求是全面协调可持续，根本方法是统筹兼顾"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "习近平"
    },
    {
      "text": "阐明中国特色社会主义道路、中国特色社会主义理论体系、中国特色社会主义制度的科学内涵及其相互联系"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "作出中国特色社会主义进入新时代、我国社会主要矛盾已经转化为人民日益增长的美好生活需要和不平衡不充分的发展之间的矛盾等重大政治论断"
    },
    {
      "text": "确立习近平新时代中国特色社会主义思想的历史地位，提出新时代坚持和发展中国特色社会主义的基本方略，确定决胜全面建成小康社会、开启全面建设社会主义现代化国家新征程的目标"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "确定抗日民族统一战线的策略方针"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "通过《关于若干历史问题的决议》"
    },
    {
      "text": "延安整风运动胜利结束"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "初步总结“大跃进”中的经验教训，开展批评和自我批评，强调加强民主集中制，切实贯彻调整国民经济的方针，以迅速扭转国民经济困难的局面"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "通过《关于建国以来党的若干历史问题的决议》"
    }
  ]
}

{
  "text": "",
  "children": [
    {
      "text": "通过《关于建国以来党的若干历史问题的决议》"
    }
  ]
}
